// Get today's date
const today = new Date();

// Subtract one day to get the previous day
const yesterday = new Date(today);
yesterday.setDate(today.getDate() - 1);

// Format the date as yyyy-mm-dd
const year = yesterday.getFullYear();
const month = String(yesterday.getMonth() + 1).padStart(2, '0'); // Month is zero-indexed
const day = String(yesterday.getDate()).padStart(2, '0');

const formattedDate = `${year}-${month}-${day}`;

// Set the formatted date to be used in a later node
return [{ json: { previousDay: formattedDate } }];

// Get the monthly search data from the "Loop Over Google Keywords" node
const loopData = $node["Loop Over Google Keywords"].json;
if (!loopData || !loopData.monthly_searches || !Array.isArray(loopData.monthly_searches)) {
  throw new Error("monthly_searches data is missing or not an array from Loop Over Google Keywords node.");
}
const monthlySearches = loopData.monthly_searches;

// Get all items from the "Add Second Tier G Keyword Data" node
const secondTierItems = $items("Add Second Tier G Keyword Data");

if (!secondTierItems || secondTierItems.length === 0) {
  throw new Error("No data found in Add Second Tier G Keyword Data node.");
}

const results = [];

// Loop through each second-tier item
secondTierItems.forEach(itemWrapper => {
  const item = itemWrapper.json;
  // Validate that the required properties exist on the second-tier item.
  if (!item.keyword || item.Id === undefined) {
    throw new Error("A second tier item is missing 'keyword' or 'Id'.");
  }

  // For each monthly search record, combine with the second-tier data
  monthlySearches.forEach(record => {
    // Validate that each monthly record has the required properties.
    if (record.year === undefined || record.month === undefined || record.search_volume === undefined) {
      throw new Error("A monthly search record is missing 'year', 'month', or 'search_volume'.");
    }

    results.push({
      json: {
        keyword: item.keyword,
        google_keyword_id: item.Id,
        year: record.year,
        month: record.month,
        search_volume: record.search_volume,
        unique_id: `${record.year}-${record.month}-${item.keyword}`
      }
    });
  });
});

// Chunk the results into batches of 1000 items each
const batchSize = 1000;
const batchedResults = [];

for (let i = 0; i < results.length; i += batchSize) {
  // Create a batch containing up to batchSize items
  const batchItems = results.slice(i, i + batchSize).map(item => item.json);
  batchedResults.push({
    json: {
      batch: batchItems
    }
  });
}

return batchedResults;

